import React from "react";
import { Nav, NavLink, NavMenu }
	from "./NavbarElements";

const Navbar = () => {
return (
	<>
	<Nav>
		<NavMenu>
		<NavLink to="/" activeStyle>
			Home
		</NavLink>
		<NavLink to="/home" activeStyle>
			All Cards
		</NavLink>
		<NavLink to="/modify" activeStyle>
			Modify Card
		</NavLink>
		<NavLink to="/add" activeStyle>
			Add Card
		</NavLink>
		</NavMenu>
	</Nav>
	</>
);
};

export default Navbar;
